import { useState, useEffect } from "react";

export default function Resenas({ idProducto }) {
  const [resenas, setResenas] = useState([]);
  const [nueva, setNueva] = useState({ calificacion: "", puntuacion: "" });
  const [editandoId, setEditandoId] = useState(null);
  const id_cliente = localStorage.getItem("id_cliente"); // login simulado

  // Cargar reseñas
  const cargarResenas = () => {
    fetch(`http://localhost:3001/resenas/${idProducto}`)
      .then(res => res.json())
      .then(data => setResenas(data));
  };

  useEffect(() => {
    cargarResenas();
  }, [idProducto]);

  // Crear nueva reseña
  const crearResena = (e) => {
    e.preventDefault();

    fetch("http://localhost:3001/resenas", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        calificacion: nueva.calificacion,
        puntuacion: nueva.puntuacion,
        id_cliente,
        id_producto: idProducto
      })
    })
    .then(() => {
      setNueva({ calificacion: "", puntuacion: "" });
      cargarResenas();
    });
  };

  // Eliminar
  const eliminarResena = (id_resena) => {
    fetch(`http://localhost:3001/resenas/${id_resena}`, {
      method: "DELETE",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ id_cliente })
    })
    .then(() => cargarResenas());
  };

  // Editar
  const guardarEdicion = (id_resena) => {
    fetch(`http://localhost:3001/resenas/${id_resena}`, {
      method: "PUT",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({
        calificacion: nueva.calificacion,
        puntuacion: nueva.puntuacion,
        id_cliente
      })
    })
    .then(() => {
      setEditandoId(null);
      setNueva({ calificacion: "", puntuacion: "" });
      cargarResenas();
    });
  };

  return (
    <div style={{ marginTop: "40px", paddingTop: "20px", borderTop: "1px solid #ccc" }}>
      <h2>Reseñas</h2>

      {/* FORM NUEVA O EDITAR */}
      <form onSubmit={editandoId ? (e) => { e.preventDefault(); guardarEdicion(editandoId); } : crearResena}>
        <input
          type="text"
          placeholder="Tu comentario"
          value={nueva.calificacion}
          onChange={(e) => setNueva({ ...nueva, calificacion: e.target.value })}
          required
        />
        <input
          type="number"
          placeholder="Puntuación (1-5)"
          value={nueva.puntuacion}
          onChange={(e) => setNueva({ ...nueva, puntuacion: e.target.value })}
          min="1"
          max="5"
          required
        />

        <button type="submit">
          {editandoId ? "Guardar Cambios" : "Agregar Reseña"}
        </button>
      </form>

      {/* LISTADO DE RESEÑAS */}
      <div style={{ marginTop: "20px" }}>
        {resenas.length === 0 && <p>No hay reseñas aún.</p>}

        {resenas.map((r) => (
          <div
            key={r.id_resena}
            style={{
              border: "1px solid #ddd",
              padding: "10px",
              marginBottom: "10px",
              borderRadius: "5px"
            }}
          >
            <strong>{r.cliente_nombre}</strong> — ⭐ {r.puntuacion}
            <p>{r.calificacion}</p>
            <small>{r.fecha}</small>

            {String(r.id_cliente) === String(id_cliente) && (
              <div style={{ marginTop: "10px" }}>
                <button
                  onClick={() => {
                    setEditandoId(r.id_resena);
                    setNueva({
                      calificacion: r.calificacion,
                      puntuacion: r.puntuacion
                    });
                  }}
                  style={{ marginRight: "10px" }}
                >
                  Editar
                </button>

                <button onClick={() => eliminarResena(r.id_resena)}>
                  Eliminar
                </button>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}
